import { useState } from "react";
import {
  Card,
  CardHeader,
  CardBody,
  Container,
  Row,
  Col,
  Form,
  FormGroup,
  Input,
  Label,
  Button,
  Alert,
} from "reactstrap";
import Header from "components/Headers/Header.js";

const ScoreSanteForm = () => {
  const [formData, setFormData] = useState({
    scoreActivite: "",
    scoreGlobale: "",
    scoreNutrition: "",
    scoreSommeil: ""
  });
  const [alert, setAlert] = useState({ visible: false, message: "", color: "" });

  // Fonction pour fermer l'alerte
  const onDismiss = () => setAlert({ ...alert, visible: false });

  const handleSubmit = async (e) => {
  e.preventDefault();
  
  try {
    const response = await fetch('http://localhost:5000/api/scores-sante', {  // ← CHANGÉ ICI
      method: 'POST',
      headers: {
        'Content-Type': 'application/json',
      },
      body: JSON.stringify({
        scoreActivite: formData.scoreActivite,
        scoreGlobale: formData.scoreGlobale, 
        scoreNutrition: formData.scoreNutrition,
        scoreSommeil: formData.scoreSommeil
      })
    });

    if (response.ok) {
      setAlert({
        visible: true,
        message: "Score santé ajouté avec succès!",
        color: "success"
      });
      setFormData({ 
        scoreActivite: "", 
        scoreGlobale: "", 
        scoreNutrition: "", 
        scoreSommeil: "" 
      });
    } else {
      throw new Error('Erreur lors de l\'insertion');
    }
  } catch (error) {
    setAlert({
      visible: true,
      message: "Erreur: " + error.message,
      color: "danger"
    });
  }
};

  const handleChange = (e) => {
    const value = Math.min(100, Math.max(0, e.target.value)); // Limite entre 0 et 100
    setFormData({
      ...formData,
      [e.target.name]: value
    });
  };

  return (
    <>
      <Header />
      <Container className="mt--7" fluid>
        <Row>
          <Col lg="6">
            <Card className="shadow">
              <CardHeader className="bg-transparent">
                <h3 className="mb-0">Nouveau Score Santé</h3>
              </CardHeader>
              <CardBody>
                {alert.visible && (
                  <Alert color={alert.color} toggle={onDismiss}>
                    {alert.message}
                  </Alert>
                )}
                <Form onSubmit={handleSubmit}>
                  <FormGroup>
                    <Label for="scoreActivite">Score Activité (0-100)</Label>
                    <Input
                      type="number"
                      min="0"
                      max="100"
                      name="scoreActivite"
                      id="scoreActivite"
                      placeholder="Ex: 85"
                      value={formData.scoreActivite}
                      onChange={handleChange}
                      required
                    />
                  </FormGroup>
                  <FormGroup>
                    <Label for="scoreGlobale">Score Globale (0-100)</Label>
                    <Input
                      type="number"
                      min="0"
                      max="100"
                      name="scoreGlobale"
                      id="scoreGlobale"
                      placeholder="Ex: 78"
                      value={formData.scoreGlobale}
                      onChange={handleChange}
                      required
                    />
                  </FormGroup>
                  <FormGroup>
                    <Label for="scoreNutrition">Score Nutrition (0-100)</Label>
                    <Input
                      type="number"
                      min="0"
                      max="100"
                      name="scoreNutrition"
                      id="scoreNutrition"
                      placeholder="Ex: 80"
                      value={formData.scoreNutrition}
                      onChange={handleChange}
                      required
                    />
                  </FormGroup>
                  <FormGroup>
                    <Label for="scoreSommeil">Score Sommeil (0-100)</Label>
                    <Input
                      type="number"
                      min="0"
                      max="100"
                      name="scoreSommeil"
                      id="scoreSommeil"
                      placeholder="Ex: 75"
                      value={formData.scoreSommeil}
                      onChange={handleChange}
                      required
                    />
                  </FormGroup>
                  <Button color="primary" type="submit">
                    Ajouter le Score Santé
                  </Button>
                </Form>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default ScoreSanteForm;
